import React from "react";
import "./Footer"

function Footer() {
  return (
    <div className="footer">
      <div>
        <span>重要告示</span>
        &nbsp;|&nbsp;
        <span>私隱政策</span>
      </div>
      <div>
        <span>最後修訂日期</span>
      </div>
    </div>
  );
}
export default Footer;
